import React, {Component} from 'react';

function Tabs(props){
    return(
        <div>
            <ul>
                <li>
                    <a className = "nav-tab-links" href="#home" onClick = {props.onNavigate}>Photos</a>
                </li>
                <li>
                    <a className = "nav-tab-links" href="#archives" onClick = {props.onNavigate}>Archived</a>
                </li>
            </ul>
        </div>
    )
}
export default Tabs;
